import './App.css';
import Data from './colleges.json'

function App() {
  return (
    <div className="App">
      <div className="posts">
        { Data.map((post) => {
          return (
            <>
              <h1>{post.discount}</h1>
            </>
          )
        })}
      </div>
    </div>
  );
}

export default App;
